INSERT INTO `tb_produtos` (`id`, `titulo`, `descricao`, `num_card`, `cvv`, `data_exp`, `fomapagto`) VALUES
	(10, 'Chuteira Nike Mercurial Vapor 13 Academy Society Unissex', '<p><b>ACELERE O SEU SONHO.</b></p><br><p>Sonhe com a velocidade e jogue rápido na Nike Mercurial Vapor 13 Academy MDS TF. O cabedal macio envolve o seu pé para um ajuste de segunda pele, enquanto o solado de borracha ajuda a turbinar a tração nos gramados.</p><br><b>Ajuste de Segunda Pele</b><p>Um forro confortável envolve o seu pé e proporciona um ajuste de segunda pele.</p><br><p><b>Texturizado para Toque</b></p><p>Material sintético macio é texturizado do calcanhar aos dedos para proporcionar o toque que você precisa para criatividade em altas velocidades.</p><br><p><b>Feita para Movimentos</b></p><p>Com base na análise do Laboratório de Pesquisa Nike Sports dos movimentos do jogador, o solado de borracha é feito para proporcionar tração multidirecional no gramado.</p><br><p><b>Detalhes do Produto</b></p><li>Para tração em superfícies sintéticas.</li><li>Entressola de espuma em 3/4 do comprimento</li><li>Palmilha Super Leve</li>', NULL, NULL, NULL, NULL),
	(11, 'Tênis Nike Air Zoom Pegasus 36 Feminino', '<p><b>UM ÍCONE FICA MAIS JUSTO E FRESCO.</b></p><br><p>O icônico Nike Air Zoom Pegasus 36 retorna com mais perfurações e mesh trabalhado no cabedal para respirabilidade direcionada em áreas de alto aquecimento. Um colarinho mais justo no calcanhar e língua reduz o volume sem comprometer o conforto, enquanto os cabos Flywire expostos proporcionam um ajuste firme em velocidades mais altas.</p><br><p><b>Benefícios</b></p><li>Perfurações no cabedal aumentam a respirabilidade no antepé e no arco.</li><li>Amortecimento Zoom Air em toda a extensão proporciona uma corrida macia e responsiva.</li><li>O corte mais justo reduz o volume para um ajuste confortável e moldado.</li><li>Cabos Flywire expostos no mediopé promovem um ajuste firme em velocidades mais altas.</li><li>Espuma Cushlon ST proporciona amortecimento macio e com ótima resposta.</li><li>Palmilha de alta resiliência se adapta ao formato do seu pé para suporte.</li><li>Pistões Waffle no solado ajudam a absorver o impacto e proporcionar tração em múltiplas superfícies.</li><li>A língua com peso reduzido do Pegasus se molda ao seu pé.</li><li>Colarinho no calcanhar se afunila em torno do tendão de Aquiles.</li>', NULL, NULL, NULL, NULL),
	(12, 'Tênis Nike Air Force 1 \'07 WB Masculino', '<p><b>AMORTECIMENTO E DESIGN ICÔNICOS.</b></p><br><p>A lenda vive no Nike Air Force 1 \'07 WB, uma atualização do icônico AF1 que oferece estilo de quadra clássico e amortecimento Premium.</p><br><p><b>Benefícios</b></p><ul><li>Uma unidade Nike Air de comprimento total oferece excelente absorção de impacto.</li><li>Uma silhueta discreta com uma sensação de nível de solo.</li><li>A borracha sem marcas em um design elegante na forma da sola proporciona tração e durabilidade.</li><li>Os cadarços tradicionais oferecem um ajuste firme e seguro.</li><li>As perfurações melhoram a ventilação.</li></ul>', NULL, NULL, NULL, NULL),
	(13, 'Tênis Nike Air Max 97 Edição Especial Masculino', '<p><b>CONFORTO E ELEGÂNCIA</b></p><br><p>O Nike Air Max 97 revolucionou o mundo da corrida com sua inovadora unidade Nike Air em toda a extensão. O Tênis Masculino Nike Air Max 97 SE atualiza o design original com novas cores e materiais.</p><br><p><b>Características do Produto</b></p><li>Cabedal em tecido, couro e material sintético.</li><li>Solado em espuma com amortecimento Air Max.</li><li>Solado de borracha.</li><br><p><b>Origem do Air Max 97</b></p><p>O amortecimento Air-Sole revolucionário da Nike foi introduzido nos calçados Nike em 1978. Em 1987, o Nike Air Max 1 foi lançado com ar visível no calcanhar, permitindo aos fãs mais do que apenas a sensação de conforto do amortecimento Air-Sole. De repente, era possível enxergá-lo. Dois anos depois de o Nike Air Max 95 ter trazido ar visível ao antepé, o Nike Air Max 97 chegou com a primeira unidade que ocupava toda a extensão do calçado. O tênis fez enorme sucesso no mundo da corrida, conforme previsto por suas linhas de design com efeito ondulado. Ainda forma ondas cerca de duas décadas depois.</p><br> ', NULL, NULL, NULL, NULL);
